<style lang="scss">
header {
	background: rgba(253, 246, 233, 0.40);
	backdrop-filter: blur(8px);
}
:root {
	--top: initial;
	--left: initial;
	--bottom: initial;
	--right: initial;
	--display: none;
}

.home_intro {
	overflow: hidden;
	position: relative;


	.main_content {
		// top: 10vw;
		@media (min-width: 1200px) {
			padding-left: calc((100vw - 1200px) / 2);
		}

		padding-left: 1.5rem;
	}

	.hover_map path.area {
		fill-opacity: 0;
	}

	.hover_map {
		path.area:not(path[name="palm_jebel_ali"]):not(path[name="the_world_islands"]):not(path[name="palm_jumeirah"]):hover {
			fill-opacity: 1;
			fill: url(#header-shape-gradient);
			cursor: pointer;
		}
		@mixin svg_custom_hover() {
			pointer-events: none;
			fill-opacity: 1;
			fill: url(#header-shape-gradient);
			cursor: pointer;
		}
		// highlight separate areas
		path[name="palm_jebel_ali"] {
			&:hover{
				& ~ .palm_jebel_ali {
					@include svg_custom_hover;
				}
			}
		}
		path[name="palm_jumeirah"] {
			&:hover{
				& ~ .palm_jumeirah {
					@include svg_custom_hover;
				}
			}
		}
		path[name="the_world_islands"] {
			&:hover{
				& ~ .the_world_islands {
					@include svg_custom_hover;
				}
			}
		}
	}


	#header-shape-gradient {
		--color-stop: #fcd07e;
		--color-bot: #5c3a1f;
	}

	.plane {
		animation: plane 5s linear 1 forwards;
		position: fixed;
		z-index: 10;
		transition: transform 5s linear;
		object-fit: contain;
		will-change: transform;
		transform: translate3d(-50rem, -13rem, 0) scale3d(0.06, 0.06, 0.06) rotate3d(0, 0, 1, -10deg);
	}

	@keyframes plane {
		0% {
			transform: translate3d(-50rem, -13rem, 0) scale3d(0.06, 0.06, 0.06) rotate3d(0, 0, 1, -10deg);
		}

		100% {
			transform: translate3d(100rem, -13rem, 0) scale3d(0.2, 0.2, 0.2) rotate3d(0, 0, 1, -30deg);
		}
	}

	.sea {
		position: relative;
		// min-height: 68.25vw;
		// aspect-ratio: 16/9;
		// @media (aspect-ratio: "16 / 9") {
		// 	height: 68.25vw;
		// }
		@media (aspect-ratio: "16 / 10") {
			height: 72.50vw;
		}

		img {
			position: absolute;
			width: 140%;
			height: 140%;
			left: 0;
			transition: transform 40s linear;
			// animation: Sea 10s linear infinite alternate-reverse normal;
			animation-name: Sea;
			animation-duration: 30s;
			animation-iteration-count: infinite;
			animation-direction: alternate;
		}
	}

	@keyframes Sea {
		0% {
			transform: translateX(-14%) scale(1);
		}

		100% {
			transform: translateX(5%) scale(1.6);
		}
	}

	.boat {
		animation-name: boat;
		animation-duration: 85s;
		transition: transform 20s linear;
		animation-fill-mode: both;
		animation-iteration-count: infinite;
		animation-direction: normal;
	}

	@keyframes boat {
		0% {
			transform: translate3d(1rem, 0rem, 0rem);
		}

		10% {
			transform: translate3d(1rem, 0rem, 0rem) rotate3d(0, 0, 1, 30deg);
		}

		20% {
			transform: translate3d(-6rem, -6rem, 0rem) rotate3d(0, 0, 1, 80deg);
		}

		35% {
			transform: translate3d(-6rem, -10rem, 0rem) rotate3d(0, 0, 1, 120deg);
		}

		45% {
			transform: translate3d(0rem, -21rem, 0rem) rotate3d(0, 0, 1, 160deg);
		}

		55% {
			transform: translate3d(15rem, -25rem, 0rem) rotate3d(0, 0, 1, 180deg);
		}

		65% {
			transform: translate3d(15rem, -25rem, 0rem) rotate3d(0, 0, 1, 170deg);
		}

		75% {
			transform: translate3d(25rem, -23rem, 0rem) rotate3d(0, 0, 1, 190deg);
		}

		85% {
			transform: translate3d(40rem, -22rem, 0rem) rotate3d(0, 0, 1, 200deg);
		}

		100% {
			transform: translate3d(53rem, -20rem, 0rem) rotate3d(0, 0, 1, 190deg);
		}
	}

	.card-item {
		border: 3px solid theme('colors.palette.gold_yellow');
		background: linear-gradient(180deg, rgba(8, 22, 33, 0.7) 0%, rgba(23, 41, 65, 0.7) 100%);
		backdrop-filter: blur(2px);
		border-radius: 15px;
		overflow: hidden;
		box-sizing: border-box;
		z-index: 1000;
		width: 300px;
		// min-height: 200px;
		left: var(--left);
		top: var(--top);
		right: var(--right);
		bottom: var(--bottom);
		display: var(--display);
		// max-width: 20rem;
		// .card_wrapper {
		// }

		.card_objects {
			background: linear-gradient(180deg, #081621 0%, #172941 100%);
			border-radius: 50px;
			border: 1px solid theme("colors.palette.light_beige");
			padding: 10px;
			text-transform: uppercase;
		}
	}

}
</style>